// src/components/ManageStudents.js
import React, { useState, useEffect } from 'react';

const ManageStudents = () => {
  const [activeBranch, setActiveBranch] = useState('CSE');
  const [students, setStudents] = useState([]);
  const [showAddForm, setShowAddForm] = useState(false);
  const [formData, setFormData] = useState({
    admission_no: '',
    name: '',
    branch: 'CSE',
    specialization: '',
    email: '',
    semester: ''
  });
  const [loading, setLoading] = useState(false);

  const branches = ['CSE', 'AIML', 'AIDS', 'ECE', 'MECH'];

  useEffect(() => {
    fetchStudents();
  }, [activeBranch]);

  const fetchStudents = async () => {
    try {
      const res = await fetch(`http://localhost:5000/api/students/${activeBranch}`);
      const data = await res.json();
      setStudents(data);
    } catch (error) {
      console.error('Error fetching students:', error);
    }
  };

  const handleAddStudent = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await fetch('http://localhost:5000/api/add_student', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });
      const data = await res.json();
      
      if (data.success) {
        setShowAddForm(false);
        fetchStudents();
        setFormData({ admission_no: '', name: '', branch: activeBranch, specialization: '', email: '', semester: '' });
      } else {
        alert(data.error);
      }
    } catch (error) {
      alert('Network error');
    }
    setLoading(false);
  };

  return (
    <div className="manage-students-container">
      {/* Branch Selection - TOP */}
      <div className="branch-selector">
        <h2 className="page-title">üë®‚Äçüéì Manage Students</h2>
        <div className="branch-buttons">
          {branches.map(branch => (
            <button
              key={branch}
              className={`branch-btn ${activeBranch === branch ? 'active' : ''}`}
              onClick={() => {
                setActiveBranch(branch);
                setFormData(prev => ({ ...prev, branch }));
              }}
            >
              <span className="branch-icon">{getBranchIcon(branch)}</span>
              {branch}
              <span className="student-count">
                {students.length} students
              </span>
            </button>
          ))}
        </div>
      </div>

      {/* Add Student Button */}
      <div className="add-student-section">
        <button 
          className="add-student-btn"
          onClick={() => setShowAddForm(!showAddForm)}
        >
          <i className="fas fa-plus-circle"></i>
          {showAddForm ? 'Cancel' : 'Add New Student'}
        </button>
      </div>

      {/* Add Student Form */}
      {showAddForm && (
        <div className="add-student-form-container">
          <form className="add-student-form" onSubmit={handleAddStudent}>
            <div className="form-grid">
              <div className="form-group">
                <label>Admission No <span className="required">*</span></label>
                <input
                  type="text"
                  value={formData.admission_no}
                  onChange={(e) => setFormData({...formData, admission_no: e.target.value})}
                  placeholder="E.g., E220160"
                  required
                />
              </div>
              <div className="form-group">
                <label>Student Name <span className="required">*</span></label>
                <input
                  type="text"
                  value={formData.name}
                  onChange={(e) => setFormData({...formData, name: e.target.value})}
                  placeholder="Enter full name"
                  required
                />
              </div>
              <div className="form-group">
                <label>Specialization</label>
                <input
                  type="text"
                  value={formData.specialization}
                  onChange={(e) => setFormData({...formData, specialization: e.target.value})}
                  placeholder="E.g., AI/ML"
                />
              </div>
              <div className="form-group">
                <label>Email</label>
                <input
                  type="email"
                  value={formData.email}
                  onChange={(e) => setFormData({...formData, email: e.target.value})}
                  placeholder="student@college.edu"
                />
              </div>
              <div className="form-group">
                <label>Semester</label>
                <select
                  value={formData.semester}
                  onChange={(e) => setFormData({...formData, semester: e.target.value})}
                >
                  <option value="">Select Semester</option>
                  <option value="1">1st Semester</option>
                  <option value="2">2nd Semester</option>
                  <option value="3">3rd Semester</option>
                  <option value="4">4th Semester</option>
                  <option value="5">5th Semester</option>
                  <option value="6">6th Semester</option>
                  <option value="7">7th Semester</option>
                  <option value="8">8th Semester</option>
                </select>
              </div>
            </div>
            <div className="form-actions">
              <button type="button" className="cancel-btn" onClick={() => setShowAddForm(false)}>
                Cancel
              </button>
              <button type="submit" className="submit-btn" disabled={loading}>
                {loading ? 'Adding...' : 'Add Student'}
              </button>
            </div>
          </form>
        </div>
      )}

      {/* Students List */}
      <div className="students-list">
        <div className="students-header">
          <h3>{activeBranch} Students ({students.length})</h3>
        </div>
        <div className="students-grid">
          {students.map((student, index) => (
            <div key={index} className="student-card">
              <div className="student-avatar">
                {student.name.charAt(0).toUpperCase()}
              </div>
              <div className="student-info">
                <h4>{student.name}</h4>
                <div className="admission-no">{student.admission_no}</div>
                {student.specialization && (
                  <div className="specialization">{student.specialization}</div>
                )}
                {student.semester && (
                  <div className="semester">Semester {student.semester}</div>
                )}
              </div>
              <div className={`face-status ${student.face_enrolled ? 'enrolled' : ''}`}>
                <i className={`fas ${student.face_enrolled ? 'fa-check-circle' : 'fa-times-circle'}`}></i>
                <span>{student.face_enrolled ? 'Face Enrolled' : 'Not Enrolled'}</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

const getBranchIcon = (branch) => {
  const icons = {
    'CSE': 'üíª',
    'AIML': 'üß†',
    'AIDS': 'ü§ñ',
    'ECE': 'üì°',
    'MECH': '‚öôÔ∏è'
  };
  return icons[branch] || 'üë®‚Äçüéì';
};

export default ManageStudents;
